import React, { Component } from 'react';
import { Button, Form, Grid,  Segment, Input, Radio } from 'semantic-ui-react'
import './index.css';

export default class SignUp extends Component {

  constructor() {
    super();

  }

  render(){
    return(
      <form class="ui form">
                  <div class="field">Selected value: <b></b></div>
                  <div class="field">
                    <div class="ui radio checkbox">
                      <input type="radio" class="hidden" name="radioGroup" readonly="" tabindex="0" value="this"/>
                      <label>Choose this</label>
                    </div>
                  </div>
                  <div class="field">
                    <div class="ui radio checkbox">
                        <input type="radio" class="hidden" name="radioGroup" readonly="" tabindex="0" value="that"/>
                        <label>Or that</label>
                    </div>
                  </div>
      </form>
    );
  }
}
